import React, { Component } from 'react';
import Headroom from 'react-headroom'



class Navigation extends Component{
    render() {
  return (
    <Headroom id='header'>

      <aside className='logo'><svg 
      		width="100%"
            height="100%"
            xmlns="http://www.w3.org/2000/svg"
            xmlnsXlink="http://www.w3.org/1999/xlink"></svg>Portfolio</aside>

      <aside className='navBar'>
        <nav>
          <ul className="container circleBehind" >
            <a href='#'>About</a>
            <a href='#'>Resume</a>
            <a href='#'>Projects</a>
            <a href='#'>Contact</a>
          </ul>
        </nav>
      </aside>

      </Headroom>
    );
  }
}

export default Navigation;
